};
return(
       <div className= "todo"> 
            <button onClick={thirdDeleteHandler} className="trash-btn">
                    <i  className="fas fa-trash"></i>

                    </button>
            <li > {text}</li>
                <button  className="complete-btn">
                    <i className="fas fa-arrow-right"></i>
                    </button>
               
             </div>
    );
}

